import React from 'react';
import Header from './Components/Header/Header';

function App() {
    return (
        <div>
            <Header />
        </div>
    );
}

window.addEventListener('resize', (event) => {
    this.parallaxController.update();
    console.log('Leaving full-screen mode.');
});

export default App;
